graphviz:
digraph {
  // Graph attributes
  label=<<table border="0" cellborder="0" cellspacing="0" cellpadding="4"><tr><td align="center"><font point-size="12"><b>Complex Nesting Test</b></font></td></tr></table>>;
  labelloc="t";
  fontsize=10;
  fontname="Arial";
  compound=true;
  rankdir=TB;
  pad=0.25;
  node [fontname="Arial", fontsize=10];
  edge [fontname="Arial", fontsize=9];

  // Node definitions with nested namespaces
  subgraph cluster_root {
    label="";
    style=filled;
    fontsize=10;
    fillcolor="#FFFFFF";
    color="#999999";
    "root" [label=<<table border="0" cellborder="0" cellspacing="0" cellpadding="4"><tr><td align="left" port="cluster_header"><b>root</b></td></tr></table>>, shape=plain, margin=0];
    "root__cluster_anchor" [shape=point, width=0.01, height=0.01, label="", style=invis, fixedsize=true];

    subgraph cluster_level1a {
      label="";
      style=filled;
      fontsize=10;
      fillcolor="#FFFFFF";
      color="#999999";
      "level1a" [label=<<table border="0" cellborder="0" cellspacing="0" cellpadding="4"><tr><td align="left" port="cluster_header"><b>level1a</b></td></tr></table>>, shape=plain, margin=0];
      "level1a__cluster_anchor" [shape=point, width=0.01, height=0.01, label="", style=invis, fixedsize=true];

      subgraph cluster_level2a {
        label="";
        style=filled;
        fontsize=10;
        fillcolor="#FFFFFF";
        color="#999999";
        "level2a" [label=<<table border="0" cellborder="0" cellspacing="0" cellpadding="4"><tr><td align="left" port="cluster_header"><b>level2a</b></td></tr></table>>, shape=plain, margin=0];
        "level2a__cluster_anchor" [shape=point, width=0.01, height=0.01, label="", style=invis, fixedsize=true];

        "level3a" [label=<<table border="0" cellborder="0" cellspacing="0" cellpadding="4"><tr><td align="left"><b>level3a</b></td></tr></table>>, shape=box, fillcolor="#FFFFFF", style=filled, color="#000000"];
        subgraph cluster_level3b {
          label="";
          style=filled;
          fontsize=10;
          fillcolor="#FFFFFF";
          color="#999999";
          "level3b" [label=<<table border="0" cellborder="0" cellspacing="0" cellpadding="4"><tr><td align="left" port="cluster_header"><b>level3b</b></td></tr></table>>, shape=plain, margin=0];
          "level3b__cluster_anchor" [shape=point, width=0.01, height=0.01, label="", style=invis, fixedsize=true];

          "level4" [label=<<table border="0" cellborder="0" cellspacing="0" cellpadding="4"><tr><td align="left"><b>level4</b></td></tr></table>>, shape=box, fillcolor="#FFFFFF", style=filled, color="#000000"];
        }
      }
      "level2b" [label=<<table border="0" cellborder="0" cellspacing="0" cellpadding="4"><tr><td align="left"><b>level2b</b></td></tr></table>>, shape=box, fillcolor="#FFFFFF", style=filled, color="#000000"];
    }
    subgraph cluster_level1b {
      label="";
      style=filled;
      fontsize=10;
      fillcolor="#FFFFFF";
      color="#999999";
      "level1b" [label=<<table border="0" cellborder="0" cellspacing="0" cellpadding="4"><tr><td align="left" port="cluster_header"><b>level1b</b></td></tr></table>>, shape=plain, margin=0];
      "level1b__cluster_anchor" [shape=point, width=0.01, height=0.01, label="", style=invis, fixedsize=true];

      "level2c" [label=<<table border="0" cellborder="0" cellspacing="0" cellpadding="4"><tr><td align="left"><b>level2c</b></td></tr></table>>, shape=box, fillcolor="#FFFFFF", style=filled, color="#000000"];
      subgraph cluster_level2d {
        label="";
        style=filled;
        fontsize=10;
        fillcolor="#FFFFFF";
        color="#999999";
        "level2d" [label=<<table border="0" cellborder="0" cellspacing="0" cellpadding="4"><tr><td align="left" port="cluster_header"><b>level2d</b></td></tr></table>>, shape=plain, margin=0];
        "level2d__cluster_anchor" [shape=point, width=0.01, height=0.01, label="", style=invis, fixedsize=true];

        "level3c" [label=<<table border="0" cellborder="0" cellspacing="0" cellpadding="4"><tr><td align="left"><b>level3c</b></td></tr></table>>, shape=box, fillcolor="#FFFFFF", style=filled, color="#000000"];
      }
    }
  }

}
